import React from 'react';
import {
  Container,
  Grid,
  Typography
} from '@material-ui/core';
import {
  Language as WebIcon
} from '@material-ui/icons';

export default function WebControlContainer(){
  return(
    <Container>
      <Grid container>
        <WebIcon />
        <Typography>Web</Typography>
      </Grid>
    </Container>
  );
};
